import React from 'react'

const Logado = () => {
  const username = localStorage.getItem('username')
  const password = localStorage.getItem('password')
  console.log(username)
  return (
    <div>
      <h1>Welcome, {username}</h1>
      <h3>Password,{password}</h3>
    </div>
  )
}

export default Logado
